import {Container} from 'react-bootstrap'

const DocumentScreen = (props) => {
    let title;
    let body;
    let nextLink
    let lastLink
    if (props.match.params.id === "0"){
        title = (
            <h1 className="text-center">Part 0: Target Members, Training and Results</h1>
        )
        body = (<div>
                        <p>Our Target Member: Students interested in national security, history, cyber security, and physical security.</p>
                        <p>Training: Over the span of one to two years, members will learn the fundamentals of security history, as well as the applications of popular security tools used by professional penetration testers.</p>
                        <p>Results: After the one-two years of training, members will be able to perform cyber security operations, do threat analyses, find and manage security vulnerabilities, and understand how these security operations apply to the world as a whole. They will also be ready to become officers and leaders within the club, maintaining and growing the club.</p>
                </div>)
        nextLink = "/doc/1"
    } else if (props.match.params.id === "1"){
        title = (
            <h1 className="text-center">Part 1: Target Members, Training and Results</h1>
        )
        body = (<div>
                        <h5>Our Target Member: Students interested in national security, history, cyber security, and physical security.</h5>
                        <h5>Training: Over the span of one to two years, members will learn the fundamentals of security history, as well as the applications of popular security tools used by professional penetration testers.</h5>
                        <h5>Results: After the one-two years of training, members will be able to perform cyber security operations, do threat analyses, find and manage security vulnerabilities, and understand how these security operations apply to the world as a whole. They will also be ready to become officers and leaders within the club, maintaining and growing the club.</h5>
                </div>)
    }
    return (
        <div className="py-3" style={{minHeight:"85vh"}}>
            <Container>
                {title}
                {body}   
            </Container>
        </div>
    )
}

export default DocumentScreen
